import React, { useState } from 'react';
import { FaSearch, FaMapMarkerAlt, FaFilter, FaTimes } from 'react-icons/fa';

const SearchBar3 = () => {
  const [isExpanded, setIsExpanded] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');
  const [location, setLocation] = useState('');
  const [category, setCategory] = useState('');

  const handleSearch = (e) => {
    e.preventDefault();
    // Handle search logic here
    console.log('Searching for:', { searchQuery, location, category });
  };

  const handleClear = () => {
    setSearchQuery('');
    setLocation('');
    setCategory('');
  };

  return (
    <div className="search-container">
      <div className={`search-bar ${isExpanded ? 'expanded' : ''}`}>
        <form onSubmit={handleSearch} className="search-form">
          <div className="search-input-group">
            <div className="search-icon">
              <FaSearch />
            </div>
            <input
              type="text"
              placeholder="¿Qué estás buscando?"
              className="search-input"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              onFocus={() => setIsExpanded(true)}
            />
            {searchQuery && (
              <button 
                type="button" 
                className="clear-button"
                onClick={() => setSearchQuery('')}
              >
                <FaTimes />
              </button>
            )}
          </div>
          
          <div className={`search-filters ${isExpanded ? 'visible' : ''}`}>
            <div className="filter-group">
              <div className="filter-icon">
                <FaMapMarkerAlt />
              </div>
              <select 
                className="location-select"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
              >
                <option value="">Ubicación</option>
                <option value="monterrey">Monterrey</option>
                <option value="cdmx">CDMX</option>
                <option value="guadalajara">Guadalajara</option>
                <option value="cancun">Cancún</option>
                <option value="tulum">Tulum</option>
              </select>
            </div>
            
            <div className="filter-group">
              <div className="filter-icon">
                <FaFilter />
              </div>
              <select 
                className="category-select"
                value={category}
                onChange={(e) => setCategory(e.target.value)}
              >
                <option value="">Todas las categorías</option>
                <option value="restaurantes">Restaurantes</option>
                <option value="hoteles">Hoteles</option>
                <option value="playas">Playas</option>
                <option value="aventura">Aventura</option>
                <option value="cultura">Cultura</option>
              </select>
            </div>
            
            <button type="submit" className="search-button">
              <FaSearch />
              <span>Buscar</span>
            </button>
          </div>
        </form>
      </div>
      {isExpanded && (
        <div className="overlay" onClick={() => setIsExpanded(false)}></div>
      )}
    </div>
  );
};

export default SearchBar3;
